import React from 'react';

const RazredRow = ({ id, razred, oznakaOdjeljenja, idSkolskaGodina }) => {
  return (
    <div>
      <p>
        <p>idRazred: {id}</p>
        <p>idSkolskaGodina: {idSkolskaGodina} </p>
        <p>razred: {razred}</p>
        <p>Odjeljenje: {oznakaOdjeljenja}</p>
      </p>
    </div>
  );
};

export default RazredRow;
